import React,{useState} from "react";

function Login(){
const[text1,setText1]=useState("")
const[text2,setText2]=useState("")
function change(){
    {window.location.href='http://ya.ru/';}
}
    return(
<div className="login">
    <div className="input_logpass">
    <input type={text1} className="input" placeholder="Введите логин" onChange={(event)=>setText1(event.target.value)}></input>
    <input type={text2} className="input" placeholder="Введите пароль" onChange={(event)=>setText2(event.target.value)}></input>
    </div>
    <div className="input_surname">
    <input type={text1} className="input_name" placeholder="Ваше имя" onChange={(event)=>setText1(event.target.value)}></input>
    <input type={text1} className="input_name" placeholder="Ваша фамилия" onChange={(event)=>setText1(event.target.value)}></input>
    </div>
    
    <div><button className="Button_reg" onClick={()=>change()}>Зарегистрироваться</button></div>

</div>
    )
}
export default Login
